// Small set of mock categories and sample expenses
export const categories = ['Food', 'Transport', 'Shopping', 'Entertainment', 'Bills', 'Other'];

export const sampleExpenses = [
  { id: 1, name: 'Pizza', category: 'Food', amount: 250, date: '2025-10-01' },
  { id: 2, name: 'Bus Ticket', category: 'Transport', amount: 40, date: '2025-10-02' },
  { id: 3, name: 'Shoes', category: 'Shopping', amount: 1500, date: '2025-10-05' },
  { id: 4, name: 'Movie', category: 'Entertainment', amount: 300, date: '2025-10-08' },
];
